    <title>Birds of Palestine</title>

<p>In order for me to write poetry that isn't political<br> 
I must listen to the birds<br> 
And in order to hear the birds<br> 
The warplanes must be silent<br>
-Marwan Makhoul<br><br>
All iNaturalist observations of birds in Palestine. Last updated September 04, 2024 at 14:01:38</p><br>
